import Header from './../header/header';
import Footer from './../footer/footer';


class Layout extends Component {
    render(){
        return(
            <div>
            <noscript>You need to enable JavaScript to run this app.</noscript>
            <Header/>
            {this.props.children}
            <Footer/>
            </div>
        );
    }
}

export default Layout;
